script: |
  super -f text -I q651.spq | sort > q651.out

inputs:
  - name: q651.spq
    data: |
      SELECT + ( - 71 ) + + cor1.col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q651.out
    data: |
      -68
      -68
      -68
      -7
      -7
      -7
      9
      9
      9
